import './App.css';
import Tabs from 'react-bootstrap/Tabs';
import Tab from 'react-bootstrap/Tab';

function App() {
  return (
    <div className="App">
      <section className='authentication-container'>
        <Tabs
          defaultActiveKey="login"
          id="tabs-element"
          className="mb-3"
        >

        </Tabs>
      </section>
    </div>
  );
}

export default App;
